import { SvgIconProps } from "../types";

export const SvgIcon = ({
  src,
  width,
  height,
  className,
  style,
}: SvgIconProps) => {
  if (src === null) {
    return null;
  }

  return (
    <img
      className={className}
      src={`/icons/${src}`}
      alt={src}
      width={width}
      height={height}
      draggable="false"
      style={style}
    />
  );
};

